import React from 'react';
import waxingIcon from '../../assets/wax.png';
import eyebrowIcon from '../../assets/eyebrow.png';
import eyelashIcon from '../../assets/eyelash.png';
import faceMask from '../../assets/face-mask.png';
import sugarIcon from '../../assets/sugar.png';
import relaxIcon from '../../assets/relax.png';

const Services = () => {
  const servicesList = [
    {
      title: 'Waxing',
      link: '/link-here',
      image: waxingIcon
    },
    {
      title: 'Sugaring',
      link: '/link-here',
      image: sugarIcon
    },
    {
      title: 'Facials',
      link: '/link-here',
      image: faceMask
    },
    {
      title: 'Eyebrows',
      link: '/link-here',
      image: eyebrowIcon
    },
    {
      title: 'Eyelashes',
      link: '/link-here',
      image: eyelashIcon
    },
    {
      title: 'Relaxation',
      link: '/link-here',
      image: relaxIcon
    }
  ];
  return (
    <div className="bg-white">
      <div className="grid grid-cols-3 gap-4 place-items-center" style={{ maxWidth: '800px' }}>
        {servicesList.map((service, index) => (
          <div key={index} className="shadow">
            <img src={service.image} alt="" className="w-20" />
            <p>{service.title}</p>
            <a href={service.link}>View Service</a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Services;
